Medicine Creek:
Commencing at the point on the eastern side of Admiralty Inlet, known as Point Pully (Three Tree Point), about midway between Commencement and Elliott Bays; thence running in a southeasterly direction, following the divide (WAU)between the waters of the Puyallup and Dwamish, or White Rivers, to the summit of the Cascade Mountains (Mt. Rainier); thence southerly, along the summit of said range (WRIA11/26 boundary - WRIA13/26) to a point opposite the main source of the Skookum Chuck Creek; thence to and down said creek, to the coal mine (actual site and  use of Centralia coal mine is general ) ; thence northwesterly (a line from chosen coal mine site to intersection with WAU line near Mima), to the summit of the Black Hills (WAU line to Capitol Peak, Larch/Rock Candy Mtns); thence northerly, to the upper forks of the Satsop River (WRIA14/23 , WRIA14/22 , WRIA14/16 boundaries); thence northeasterly (following WRIA14/16 boundary to WAU intersection above Great Bend on Hood Canal, then along WAU divide between Hood Canal and the remainder of WRIA 14), through the portage known as Wilkes's Portage (The Wilkes Portage referred to in the Medicine, Point No Point and Point Elliot treaties is either between Case Inlet and Lynch Cover or between Sinclair Inlet and Lynch Cove, on Hood Canal. Since neither is specified a line was chosen continuing along the ridge line [WAU] paralleling the Union River, then south and east along WAU and ridge crests south of Long Lake)  , to Point Southworth  on the western side of Admiralty Inlet; thence around the foot (northern tip) of Vashon's Island, easterly and southeasterly, to the place of beginning. See Washington State Univ. map link below;
